import {RouterProvider,createBrowserRouter} from 'react-router-dom';
import HomePage from './pages/Homepage';
import EventPage from './pages/EventsPage.jsx'
import { loader as eventsLoader } from './pages/Event.jsx';
import NewEventPage from './pages/NewEventPage.jsx'
import EventRoot from './pages/EventRoot.jsx';
import Rootlayout from './pages/Root.jsx'
import EventDetail from './pages/EventDetailPage.jsx';
import errorshowing from './pages/Error.jsx';
const router = createBrowserRouter([

  { path:'/',element:<Rootlayout/>, errorElement:errorshowing,children:[
    {index:true,element:<HomePage/>},

      {path:'events/',element:<EventRoot/>,children:[  
  {index:true,element:<EventPage/>,loader:eventsLoader},
        {path: 'new',element:<NewEventPage/>},
        {path: ':id',element:<EventDetail/>}]},

    ]},
    // ] },

])

function App() {
  return <RouterProvider router={router} />
}

export default App;
